import React from 'react'

const Colors=(props)=> {
    return (
        <div className="colors-container" >
            <div onClick={()=>props.penColorChange(COLORS.RED)} className={(penColor===COLORS.RED)?"color-selected":"color"} id="color-red" />
            <div onClick={()=>props.penColorChange(COLORS.YELLOW)} className={(penColor===COLORS.YELLOW)?"color-selected":"color"} id="color-yellow" />
            <div onClick={()=>props.penColorChange(COLORS.BLUE)} className={(penColor===COLORS.BLUE)?"color-selected":"color"} id="color-blue" />
            <div onClick={()=>props.penColorChange(COLORS.GREEN)} className={(penColor===COLORS.GREEN)?"color-selected":"color"} id="color-green" />
            <div onClick={()=>props.penColorChange(COLORS.ORANGE)} className={(penColor===COLORS.ORANGE)?"color-selected":"color"} id="color-orange" />
        </div>
    )
}

export default Colors
